import React, { Component } from 'react';

class Lottery extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <h1> {this.props.title} </h1>
        <h1>Lottery Component</h1>
      </div>
    );
  }
}

export default Lottery;
